import React from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './components/navbar/NavBar';
import Sea from './components/navbar/sea.png';
function App() {
  return (
    <div className="App">
     <NavBar/>
     <img src={Sea}/>
    </div>
  );
}

export default App;
